import React, { useState} from 'react'

import axios from 'axios'

import { Redirect, useHistory } from 'react-router-dom'


import MaterialDatePicker from '../../../global/date/MaterialDatePicker'

/* import { Calendar } from 'react-date-range';
import 'react-date-range/dist/styles.css'; // main css file
import 'react-date-range/dist/theme/default.css'; // theme css file */
/* import Calendar from 'react-calendar'; */

import RoundedButton from '../../../global/buttons/RoundedButton'

import './css/SearchForm.scss'

const SearchForm = (props) => {
    const [submitted, setSubmitted] = useState(false);

    const handleSubmit = (event) => {
        /* alert("L'utilisateur a était soumis ");
        event.preventDefault();
        return (
            <Redirect
            to={{
                pathname: '/searh_result',
                state: {}
            }}
            />
        ) */

        event.preventDefault()
        axios.get('http://localhost:8080/vhe/vhes_list/').then(result => {
        /* axios.get('http://10.0.4.5:8000/vhe/vhe/').then(result => { */
            console.log(result)
            const response = result.data
        }).catch(e => {
            console.log('Error getting data: ' + e)
        })
    }

    if (submitted) {
        return (
            <>
                <Redirect push to={{
                    pathname: '/search_result',
                    state: {}
                }}/>
            </>
        )
    }

    return (
        <>
            <form
                id='search_home_FORM'
                className='p-medium'
                onSubmit={handleSubmit}
            >
                <div className='border-left'>
                    <label for='location'>
                        <span>Location</span>
                    </label>
                    <input type='text' id='location' className='grey_COLOR' name='location' placeholder='Amsterdam' />
                </div>
                <div className='border-left padding-left'>
                    <label for='propertyType'>
                        <span>Property type</span>
                    </label>
                    <input type='text' id='propertyType' className='grey_COLOR' name='propertyType' placeholder='Room' />
                </div>
                <div className='border-left padding-left'>
                    <label for='range'>
                        <span>Range</span>
                    </label>
                    <input type='text' id='range' className='grey_COLOR' name='range' placeholder='$1000 - $2700' />
                </div>
                <div className=' padding-left'>
                    <label for='date'>
                        <span>Date</span>
                    </label>
                    <div id='datePickers_home_DIV'>
                        <MaterialDatePicker />
                        <MaterialDatePicker />
                    </div>
                </div>
                <RoundedButton
                    button_CLASSNAME={'blue_ROUNDEDBUTTON extra_large_ROUNDEDBUTTON'}
                    button_ID={'services_header_BUTTON'}
                    span_text_CLASSNAME={'p-medium white_COLOR'}
                    button_TEXT={'Search'}
                    Arrow002={false}
                />
            </form>
        </>
    )
}

export default SearchForm
